import './App.css';
import React from 'react'; 
import Navbar from './Navbar';



function App() {
  return(
  <div className="App">
    <Navbar />          
    /* Navbar is a component */
    <div className="content">
      <h1>App component</h1>
    </div>
  </div>
  );
}

export default App;
